import { ApiProperty } from "@nestjs/swagger";
import { Type } from "class-transformer";
import { IsBoolean, IsDate, IsString } from "class-validator";

export class CreateUserDto {

    @ApiProperty({ example: 'Jon' })
    @IsString()
    readonly fname : string;

    @ApiProperty({ example: 'Arbuckle' })
    @IsString()
    readonly lname : string

    @ApiProperty({ example: 'ArbuckleJon123' })
    @IsString()
    readonly usrname : string

    @ApiProperty({ example: 'base64Picture' ,default:''})
    @IsString()
    readonly profilepicture : string

    @ApiProperty({ example: 'ArbuckleJon@example.com' })
    @IsString()
    readonly email : string

    @ApiProperty({ example: '123456789' })
    @IsString()
    readonly password : string

    @ApiProperty({ example: '2025-01-01' })
    @Type(() => Date) // This will transform the string into a Date object
    @IsDate()
    readonly bdate : Date

    @ApiProperty({ example: 'male' })
    @IsString()
    readonly sex : string

    @ApiProperty({ example: true })
    @IsBoolean()
  readonly isAdmin: boolean;

}
